import { useState, useEffect } from 'react';

import MeetupList from '../components/meetups/MeetupList';

const KEY = 'AIzaSyC_7L7y5VknIyNN6IGQ0w1Dp1pWvMQmaYI';

let options = {
  part: 'snippet',
  key:KEY,
  maxResults: 5,
    q: 'game'
};

function AllMeetupsPage() {
  const [isLoading, setIsLoading] = useState(true);
  const [loadedMeetups, setLoadedMeetups] = useState([]);

  useEffect(() => {
    setIsLoading(true);
    fetch(
      'https://www.googleapis.com/youtube/v3/search',options
    )
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        const meetups = [];

        for (const key in data) {
          const meetup = {
            id: key,
            ...data[key]
          };

          meetups.push(meetup);
        }

        setIsLoading(false);
        setLoadedMeetups(meetups);
      });
  }, []);

  if (isLoading) {
    return (
      <section>
        <p>Loading...</p>
      </section>
    );
  }

  return (
    <section>
      <h1>All Meetups</h1>
      <MeetupList meetups={loadedMeetups} />
    </section>
  );
}

export default AllMeetupsPage;
